import base64
import io
import os
import tempfile
from PIL import Image
import pytesseract
from llama_index.core import SimpleDirectoryReader
from groq import Groq
import re
import json


def extract_mcqs_from_base64(base64_string, file_extension):
    def extract_text_from_image(image_data):
        image = Image.open(io.BytesIO(image_data))
        text = pytesseract.image_to_string(image)
        return text

    def extract_text_from_pdf(pdf_data):
        with tempfile.TemporaryDirectory() as temp_dir:
            temp_file_path = os.path.join(temp_dir, "temp_file.pdf")
            with open(temp_file_path, "wb") as f:
                f.write(pdf_data)

            reader = SimpleDirectoryReader(input_files=[temp_file_path])
            documents = reader.load_data()

            if documents:
                return " ".join([doc.text for doc in documents])
            else:
                return ""

    def parse_and_format_mcqs_with_groq(text):
        client = Groq(api_key='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')
        response = client.chat.completions.create(
            model="llama-3.1-70b-versatile",
            messages=[
                {
                    "role": "system",
                    "content": "You are a helpful assistant that extracts and formats multiple-choice questions (MCQs) from text."
                },
                {
                    "role": "user",
                    "content": f"""Extract the questions and options from the following text, and format them as a numbered list of questions with their options. Each question should be on a new line, preceded by its number, followed by its options (A, B, C, D) on separate lines. Here's the text:

    {text}

    Format the output as follows:
    1. [Question text]
    A) [Option A]
    B) [Option B]
    C) [Option C]
    D) [Option D]

    2. [Question text]
    A) [Option A]
    B) [Option B]
    C) [Option C]
    D) [Option D]

    ... and so on.

    Respond only with the formatted questions and options, no additional text."""
                }
            ],
            temperature=0.25,
            max_tokens=1024,
            top_p=1,
            stream=False,
            stop=None
        )

        return response.choices[0].message.content

    def process_raw_mcq_text(raw_text):
        pattern = r'(\d+)\.\s+(.*?)\nA\)\s+(.*?)\nB\)\s+(.*?)\nC\)\s+(.*?)\nD\)\s+(.*?)(?:\n|$)'
        matches = re.findall(pattern, raw_text, re.DOTALL)

        mcq_data = []
        for match in matches:
            question_number = int(match[0])
            question = match[1].strip()
            options = [opt.strip() for opt in match[2:]]
            mcq_data.append({
                "question_number": question_number,
                "question": question,
                "options": {
                    "A": options[0],
                    "B": options[1],
                    "C": options[2],
                    "D": options[3]
                }
            })

        return mcq_data

    # Decode base64 string
    file_data = base64.b64decode(base64_string)

    # Extract text based on file type
    if file_extension.lower() in ['.png', '.jpg', '.jpeg']:
        text = extract_text_from_image(file_data)
    elif file_extension.lower() == '.pdf':
        text = extract_text_from_pdf(file_data)
    else:
        raise ValueError("Unsupported file type")

    if text:
        # Process text in chunks if it's too long
        max_chunk_length = 4000
        chunks = [text[i:i + max_chunk_length] for i in range(0, len(text), max_chunk_length)]

        all_mcq_data = []
        question_number = 1
        for chunk in chunks:
            raw_mcq_text = parse_and_format_mcqs_with_groq(chunk)
            mcq_data = process_raw_mcq_text(raw_mcq_text)

            # Update question numbers to ensure continuity
            for mcq in mcq_data:
                mcq['question_number'] = question_number
                question_number += 1

            all_mcq_data.extend(mcq_data)

        return json.dumps(all_mcq_data, ensure_ascii=False, indent=2)
    else:
        return json.dumps({"error": "No text found in the document"})


base64_string = ""
file_extension = ".pdf"  # or ".png", ".jpg", etc.
result = extract_mcqs_from_base64(base64_string, file_extension)
print(result)
